import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="link-servizi">
          <div className="link-chi-siamo" onClick={(e) => scrollToSection(e.view)}>Chi Siamo</div>
          <div className="link-lavorazioni" onClick={(e) => scrollToSection(e.target.className)}>Lavorazioni</div>
          <div className="link-contatti" onClick={(e) => scrollToSection(e.target.className)}>Contatti</div>
          <div className="language-selector">IT</div>
        </div>
      </header>
      <div className="App-body">
        <div className="chi-siamo"></div>
        <div className="lavorazioni"></div>
        <div className="contatti"></div>
      </div>
    </div>
  );
}

function scrollToSection(link) {
  console.log(link);
}

export default App;
